package main
import (
  "bytes"
  "compress/gzip"
  "encoding/base64"
  "io"
  "github.com/computeportal/glui"
)
const (
  camel_data =""
)
var camel = &glui.ImageData{nil, 651, 596}
func load_camel() bool {
  b, err := base64.StdEncoding.DecodeString(camel_data)
  if err != nil {panic(err)}
  r, err := gzip.NewReader(bytes.NewBuffer(b))
  if err != nil {panic(err)}
  c := &bytes.Buffer{}
  io.Copy(c, r)
  camel.Pix = c.Bytes()
  return true
}
var camel_loaded = load_camel()